import axios from 'axios';

console.log("entry"); 
async function fetchData(){
    // access data directly in json format not in promise
    const userDataJson= await axios.get('https://api.github.com/orgs/axios'); 
    console.log(userDataJson.data);
}
fetchData(); 

export default fetchData;
